	add("hathos", "{\"term\":\"hathos\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|hate|pathos|lang\u003den}}. According to journalist Alex Heard, this word was coined in 1985 when he was searching for a word to describe the \u0026quot;cringe-y feeling you get when celebs go AWOL\u0026quot; and attended a w:Super Bowl|Super Bowl party where he and another guest, then-w:Bob Dole|Bob Dole press aide Scott Richardson, exchanged ideas until they came up with \u0026quot;hathos.\u0026quot;\u0026lt;ref name\u003d\u0026quot;heard\u0026quot;\u0026gt;\u0026quot;[http://thehathos.wordpress.com/2008/12/22/more-on-the-origins-of-hathos/ More on the origins of Hathos]\u0026quot;\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;w:Andrew Sullivan|Andrew Sullivan, \u0026quot;[http://sullivanarchives.theatlantic.com/index.php.dish_inc-archives.2001_06_01_dish_archive.htm. 4157771 I AM HATHOS!]\u0026quot;, \u0027The Daily Dish\u0027, 21 June 2001\u0026lt;/ref\u0026gt; The word\u0027s first apparent use in print was in an essay by Heard, published in the \u0027w:The Washington Post|The Washington Post\u0027 on May 17, 1987.\u0026lt;ref\u0026gt;[http://www.wordspy.com/words/hathos.asp hathos] on WordSpy.com\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Enjoyment derived from hatred of a person or thing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, w:Rod Rod Dreher, \u0026quot;[http://articles.sun-sentinel.com/1996-01-07/entertainment/9601040394_1_kathie-lee-gifford-television-show-regis Hate it, Love it]\u0026quot;, \u0027Sun-Sentinel\u0027, 7 January 1996\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The patron saint of \u0027\u0027hathos\u0027\u0027 connoisseurs, H.L. Mencken, was a brave soul, but even a fellow as sturdy and unstinting as he might have been struck dumb in the presence of the extravagantly hathotic Kathie Lee Gifford\", \"priority\":3}]}, \"synonyms\":{}}");

